import { Link } from 'react-router-dom';
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import './index.scss';

const Home = () => {
    const responsive = {
        superLargeDesktop: {
          // the naming can be any, depends on you.
          breakpoint: { max: 4000, min: 3000 },
          items: 5
        },
        desktop: {
          breakpoint: { max: 3000, min: 1024 },
          items: 3
        },
        tablet: {
          breakpoint: { max: 1024, min: 464 },
          items: 2
        },
        mobile: {
          breakpoint: { max: 464, min: 0 },
          items: 1
        }
    };
    return (
        <div className="container downloads-page">
            <div className="title">
                <h1 className='ar-title'>ï·½</h1>
            </div>
            <Carousel responsive={responsive}>
                <div className='card'>
                    <img src='https://images.unsplash.com/photo-1560769629-975ec94e6a86?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTJ8fHByb2R1Y3RzfGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60'/>
                    <h2 className='file-title'>Sneaker</h2>
                    <h3 className='file-type'></h3>
                    <p className='file-description'>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>
                    <Link to="/downloads" className='flat-button'>GET RESSOURCES</Link>
                </div>
                <div className='card'>
                    Item2
                </div>
                <div className='card'>
                    Item3
                </div>
                <div className='card'>
                    Item4
                </div>
            </Carousel>;
        </div>

    )
}
